import React from "react";
import { Routes ,Route } from "react-router-dom";
import Home from "./page/home";
import Main from "./page/main";

export default function App() {
    return (

      <div className='app'>

        <Routes>
        <Route path='/' element={<Home/>}/>
        <Route path='/main' element={<Main/>}/>
        </Routes>

      </div>
    )
  }
